import React, { useEffect, useState } from 'react';
import axios from 'axios';

const TenantsPage = () => {
  const [tenants, setTenants] = useState([]);
  const [loading, setLoading] = useState(true);
  const [searchTerm, setSearchTerm] = useState('');
  const [filterStatus, setFilterStatus] = useState('all');
  const user = JSON.parse(localStorage.getItem('user'));

  useEffect(() => {
    async function fetchTenants() {
      try {
        const res = await axios.get('/api/users?role=tenant', {
          headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
        });
        setTenants(res.data);
      } catch (err) {
        console.error('‚ùå Fetch tenants error:', err);
      } finally {
        setLoading(false);
      }
    }
    fetchTenants();
  }, []);

  if (!user || user.role !== 'admin') {
    return <p style={unauthorizedStyle}>üö´ Unauthorized access</p>;
  }

  if (loading) {
    return <p style={loadingStyle}>Loading tenants...</p>;
  }

  // Filter + search logic
  const filteredTenants = tenants.filter((t) => {
    const matchesSearch = t.name.toLowerCase().includes(searchTerm.toLowerCase());
    const matchesStatus =
      filterStatus === 'all' || (t.lease_status || 'active').toLowerCase() === filterStatus;
    return matchesSearch && matchesStatus;
  });

  return (
    <div style={pageStyle}>
      <h2 style={headingStyle}>üë• Registered Tenants</h2>

      {/* Search + Filter Controls */}
      <div style={controlsStyle}>
        <input
          type="text"
          placeholder="Search by name..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          style={searchInput}
        />
        <select
          value={filterStatus}
          onChange={(e) => setFilterStatus(e.target.value)}
          style={selectStyle}
        >
          <option value="all">All Statuses</option>
          <option value="active">Active</option>
          <option value="inactive">Inactive</option>
          <option value="pending">Pending</option>
        </select>
      </div>

      {filteredTenants.length === 0 ? (
        <p style={emptyStyle}>No tenants found.</p>
      ) : (
        <div style={gridStyle}>
          {filteredTenants.map((t) => (
            <div key={t.id} style={cardStyle}>
              <h3 style={tenantName}>{t.name}</h3>
              <p><strong>Email:</strong> {t.email}</p>
              <p><strong>Phone:</strong> {t.phone || 'N/A'}</p>
              <p><strong>Lease Status:</strong> {t.lease_status || 'Active'}</p>
              <div style={buttonRow}>
                <button style={viewButton}>View</button>
                <button style={editButton}>Edit</button>
                <button style={deleteButton}>Remove</button>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

/* Styles */
const pageStyle = { padding: '2rem', backgroundColor: '#f4f6f8', minHeight: '100vh', fontFamily: 'Segoe UI, sans-serif' };
const headingStyle = { fontSize: '2rem', marginBottom: '1.5rem', color: '#333', textAlign: 'center' };
const loadingStyle = { textAlign: 'center', fontSize: '1.2rem', marginTop: '3rem', color: '#555' };
const unauthorizedStyle = { textAlign: 'center', fontSize: '1.2rem', marginTop: '3rem', color: '#c00' };
const emptyStyle = { textAlign: 'center', color: '#777', fontStyle: 'italic' };

const controlsStyle = { display: 'flex', justifyContent: 'center', gap: '1rem', marginBottom: '2rem' };
const searchInput = { padding: '0.5rem 1rem', borderRadius: '6px', border: '1px solid #ccc', width: '250px' };
const selectStyle = { padding: '0.5rem 1rem', borderRadius: '6px', border: '1px solid #ccc' };

const gridStyle = { display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', gap: '1.5rem' };
const cardStyle = { backgroundColor: '#fff', borderRadius: '10px', boxShadow: '0 4px 12px rgba(0,0,0,0.1)', padding: '1.5rem' };
const tenantName = { fontSize: '1.2rem', fontWeight: 'bold', marginBottom: '0.75rem', color: '#0078D4' };

const buttonRow = { display: 'flex', justifyContent: 'space-between', marginTop: '1rem' };
const viewButton = { padding: '0.5rem 1rem', backgroundColor: '#0078D4', border: 'none', borderRadius: '6px', color: '#fff', cursor: 'pointer' };
const editButton = { padding: '0.5rem 1rem', backgroundColor: '#ffc107', border: 'none', borderRadius: '6px', cursor: 'pointer' };
const deleteButton = { padding: '0.5rem 1rem', backgroundColor: '#dc3545', border: 'none', borderRadius: '6px', color: '#fff', cursor: 'pointer' };

export default TenantsPage;
